import React from 'react';
import style from './sideNav.module.css';
import FontAwesome from 'react-fontawesome';
import {Link} from 'react-router-dom';


const itemList = [
    {
        type: style.option,
        icon: 'home',
        text: 'Home',
        link: '/'
    },
    {
        type: style.option,
        icon: 'file-text-o',
        text: 'News',
        link: '/news'
    }
]

const navItems = () => {
    itemList.map((item) => {
        return(
            <div className = {item.type}>
                <Link to={item.link}>
                    <FontAwesome name={item.icon}/>
                    {item.text}
                </Link>
            </div>
        )
    })
}

const SideNavItems = () => {
    return(
        <div>
            {navItems()}
        </div>
    );
}

export default SideNavItems;
